description.text:
Full instruction are here:<br />
<a rel="nofollow" href="http://airtripper.com/1594/hex-nut-capture-socket-sizing-for-3d-printing" >http://airtripper.com/1594/hex-nut-capture-socket-sizing-for-3d-printing</a>  
Download the OpenSCAD file or use the Thingiverse Customiser to get the required STL files you need.  
//  - Select part to view/print from list<br />
view_part = 1;  // [0:design, 1:head_up, 2:head_down, 3:horizontal]  
//  - Screw head diameter - flat side to flat side on hex nut or bolt head<br />
head = 6.75;<br />
//  - Screw head type - [6] for hex head and [50] or more for round head<br />
type = 6;<br />
//  - Screw size diameter<br />
size = 3.65;<br />
//  - Screw size diameter smoothness<br />
smoothness = 50;<br />
//  - Screw size length - not including screw head<br />
length = 5;<br />
//  - Screw head length<br />
cap = 3;<br />
//  - Block border thickness between screw head and block edge<br />
border = 4;<br />
//  - Print layer thickness - only required for head down print<br />
layer = 0.25;
